import React, { Component } from 'react';
import { Table } from 'antd';

const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'ID',
      dataIndex: 'id',
      key: 'id',
    },
    {
      title: 'Flags',
      dataIndex: 'flags',
      key: 'flags',
    },
  ];

class UsersTable extends Component {  
    render () {
        return (
            <Table size='default' dataSource={this.props.dataSource} columns={columns} />
        )
    }
}
export default UsersTable
